from collections import defaultdict

def determine_winner(test_cases):
    results = []
    for case in test_cases:
        (N, piles) = case
        d = defaultdict(int)
        for pile in piles:
            d[pile] -= 1
        b = []
        for (key, value) in d.items():
            if value % 2 == 1:
                b.append(key)
        count = 0
        for i in b:
            count = count ^ i
        if count == 0 or len(b) % 2 == 0:
            results.append('First')
        else:
            results.append('Second')
    return results

